import React from 'react' ;

class UserList extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            hover : false 
        }
        this.testMouseEnter = this.testMouseEnter.bind(this);
        this.testMouseOut = this.testMouseOut.bind(this);
    }
    testMouseEnter = () =>{
       this.setState({
           hover : true 
       });
       const user = {
        id : this.props.user.id,
        name : this.props.user.name,
        age : this.props.user.age,
        email : this.props.user.email,
        address : this.props.user.addresss
    }
       this.hoverRender(user) ;
    }
    testMouseOut = () =>{
        this.setState({
            hover: false 
        });
  }
    hoverRender(userdetail) {
        return (
            <tr>
                <td>{userdetail.id}</td>
                <td>{userdetail.name}</td>
                <td>{userdetail.age}</td>
                <td>{userdetail.email}</td>
                <td>{userdetail.address}</td>
            </tr>
        );
    }

    render () {
        return (
            <tr onMouseEnter={this.testMouseEnter} onMouseOut={this.testMouseOut}>
                <td>{this.props.user.id}</td>
                <td>{this.props.user.name}</td>
                <td>{this.props.user.age}</td>
                <td>{this.props.user.email}</td>
                <td>{this.props.user.address}</td>
            </tr>
        );
    }
}

export default UserList ;
